import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";

const Testimonials = () => {
  return (
    <section className="py-16 bg-gradient-to-r from-indigo-500 to-purple-600 text-white">
      <h2 className="text-3xl font-bold text-center mb-8">What Our Clients Say</h2>
      <Swiper spaceBetween={30} slidesPerView={1} autoplay={{ delay: 3000 }}>
        <SwiperSlide>
          <p className="text-xl">"Amazing results with PR Sparkz!"</p>
          <span>- Client A</span>
        </SwiperSlide>
        <SwiperSlide>
          <p className="text-xl">"Boosted our engagement massively."</p>
          <span>- Client B</span>
        </SwiperSlide>
      </Swiper>
    </section>
  );
};

export default Testimonials;
